import React, { Component } from "react";
import WelcomeImg from "./images/welcome.png";
import "./Card.css";

class Card extends Component {
  render() {
    return <div className='Card'>
        <a href={p.link}>
            <div className="card-category hvr-grow hvr-sweep-to-bottom" style={{backgroundImage: p.img }}>
                <p>
                    { p.desc }
                </p>
            </div>
        </a>
    </div>;
  }
}
export default Card;
